import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import App2 from './App';
import * as serviceWorker from './serviceWorker';


var app = true;
var app2 = true;
var seed = "";

if(app){
    seed  += "<div id ='app'></>\n";
}

if(app2){
    seed += "<div id ='app2'></>\n";
}

document.getElementById('root').innerHTML = seed;

ReactDOM.render(<App />, document.getElementById('app')); //the value, destination in index 
ReactDOM.render(<App2 />, document.getElementById('app2')); //the value, destination in index




// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
